export function getStaticProps() {
  const template =
    '<div id="rsg-root"></div><script src="/build/bundle.js"></script>';
  return template;
}
const Docs = ({ template }) => (
  <div dangerouslySetInnerHTML={{ __html: `${template}` }}>
    <p>No Styleguide found. Did you remember to build it?</p>
  </div>
);

export default Docs;
